// src/components/Dashboard/Dashboard.jsx
import React, { useState, useEffect } from 'react';
import { Line } from 'react-chartjs-2';
import { MapContainer, TileLayer, Polyline } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import api from '../../utils/api';
import { getCurrentLocation, simulateGpsData, smartGpsTracking, generateSimulatedRoute } from '../../utils/geolocation';
import './Dashboard.scss';
import BatchProcessing from '../BatchProcessing/BatchProcessing';

const Dashboard = () => {
  const [gpsData, setGpsData] = useState([]);
  const [chartData, setChartData] = useState(null);
  const [route, setRoute] = useState([]);
  const [isTracking, setIsTracking] = useState(false);
  const [dailyResults, setDailyResults] = useState(null);

  // **1. Start or stop GPS tracking**
  const toggleTracking = () => {
    if (isTracking) {
      setIsTracking(false);
    } else {
      setIsTracking(true);
      startTracking();
    }
  };

  // **Simulate GPS tracking for testing**
  const startTracking = () => {
    const simulatedBatches = generateSimulatedRoute(1, 5); // Generate 5 GPS batches for driver_id 1
    simulatedBatches.forEach((batch, index) => {
      setTimeout(() => processBatch(batch), index * 5000); // Process each batch after 5 seconds
    });
  };

  // **2. Process each batch of GPS data**
  const processBatch = async (batch) => {
    const isMoving = smartGpsTracking(batch.gps_data, gpsData); // Check if car is moving

    if (isMoving) {
      try {
        const driver_id = localStorage.getItem('driver_id'); // Get driver ID from localStorage
        const response = await api.post('/record-telematics', {
          driver_id,
          gps_data: batch.gps_data, // Send GPS data for processing
        });

        // Update route for map display
        setGpsData((prevData) => [...prevData, ...batch.gps_data]);
        setRoute((prevRoute) => [
          ...prevRoute,
          ...batch.gps_data.map((point) => [point.Latitude, point.Longitude]),
        ]);

        // **Update chart** with telematics features (speed, acceleration)
        updateChart(response.data.features);
      } catch (error) {
        console.error('Error recording telematics data:', error);
      }
    }
  };

  // **3. Update the chart with new telematics data**
  const updateChart = (features) => {
    const chartLabels = features.map((_, i) => `Batch ${i + 1}`);
    setChartData({
      labels: chartLabels,
      datasets: [
        {
          label: 'Speed (m/s)',
          data: features.map((f) => f['Speed(m/s)']),
          borderColor: 'rgba(75, 192, 192, 1)',
          fill: false,
        },
        {
          label: 'Acceleration (m/s²)',
          data: features.map((f) => f['Acceleration(m/s^2)']),
          borderColor: 'rgba(255, 99, 132, 1)',
          fill: false,
        },
      ],
    });
  };

  // **4. Automatically call `process_daily_data` at midnight**
  const fetchDailyResults = async () => {
    const driver_id = localStorage.getItem('driver_id');
    const response = await api.post('/process-daily-data', { driver_id });
    setDailyResults(response.data);
  };

  useEffect(() => {
    const checkForMidnight = () => {
      const currentTime = new Date();
      const isMidnight = currentTime.getHours() === 0 && currentTime.getMinutes() === 0;

      if (isMidnight) {
        fetchDailyResults(); // Automatically call `process_daily_data` at midnight
      }
    };

    const intervalId = setInterval(checkForMidnight, 60000); // Check every minute
    return () => clearInterval(intervalId);
  }, []);

  return (
    <div className="dashboard-container">
      <h2>Driver Dashboard</h2>

      <div className="tracking-controls">
        <button onClick={toggleTracking}>
          {isTracking ? 'Stop Tracking' : 'Start Tracking'}
        </button>
      </div>

      {/* Map Section */}
      <div className="map-section">
        <h3>Route Map</h3>
        <MapContainer center={[26.6337, 92.7926]} zoom={14} scrollWheelZoom={false} className="map-container">
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution="&copy; OpenStreetMap contributors"
          />
          <Polyline positions={route} color="blue" />
        </MapContainer>
      </div>

      {/* Chart Section */}
      <div className="chart-section">
        <h3>Driving Feature Fluctuations</h3>
        {chartData ? <Line data={chartData} /> : <p>No data available yet.</p>}
      </div>

      {/* Daily Results Section */}
      <div className="daily-results">
        <h3>Daily Results</h3>
        {dailyResults ? (
          <div>
            <p>Total Distance: {dailyResults.total_distance_covered_km} km</p>
            <p>Driving Score: {dailyResults.driving_score}</p>
            <p>Driving Category: {dailyResults.driving_category}</p>
          </div>
        ) : (
          <p>No daily results yet.</p>
        )}
      </div>

      {/* Batch Processing Component */}
      <BatchProcessing gpsData={gpsData} />
    </div>
  );
};

export default Dashboard;
